import React from "react";
import "./Project.css";

const ProjectTechnology = ({ technologies }) => {
  return (
    <div>
      <div className="technology-item">
        <SiCsharp />
      </div>
      <div className="technology-item">
        <IoLogoJavascript />
      </div>
    </div>
  );
};

export default ProjectTechnology;
